// PuppyCardSkeleton.js
import './PuppyCardSkeleton.css';

function PuppyCardSkeleton() {
    return (
        <div className="puppy-card-skeleton">
            <div className="puppy-card-skeleton-image"></div>
            <div className="puppy-card-skeleton-content">
                <div className="puppy-card-skeleton-text"></div>
                <div className="puppy-card-skeleton-text short"></div>
                <div className="puppy-card-skeleton-text short"></div>
            </div>
        </div>
    );
}

export default PuppyCardSkeleton;
